import Datas from '../datas/data.json'

function Offers () {
    return(
        <div className='cards_container'>
            <div>{Datas.map((offers, index) => {
            return (
                <div key={index.id}>
                    <h2>{offers.title}</h2>
                    <img src={offers.cover} alt={offers.title}></img>
                </div>
            )}
    )}
            </div>
        </div>
)
}

export default Offers
